import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Auth from "./components/auth/Auth";
import Main from "./components/Main";
import AdminDashboard from "./components/dashboard/adminDashboard/AdminDashboard"; // Ensure these are correctly imported
import MentorDashboard from "./components/dashboard/mentorDashboard/MentorDashboard";
import MenteeDashboard from "./components/dashboard/menteeDashboard/MenteeDashboard";

import { SocketContext, socket } from "./socket/socket";

const App = () => {
    return (
        <React.StrictMode>
            <BrowserRouter>
                <SocketContext.Provider value={socket}>
                    <Switch>
                        <Route path="/" exact component={Main} />

                        {/* Authentication Routes */}
                        <Route path="/admin" exact component={Auth} />
                        <Route path="/mentor" exact component={Auth} />
                        <Route path="/mentee" exact component={Auth} />

                        {/* Dashboard Routes */}
                        <Route path="/admin/dashboard" exact component={AdminDashboard} />
                        <Route path="/mentor/dashboard" exact component={MentorDashboard} />
                        <Route path="/mentee/dashboard" exact component={MenteeDashboard} />
                    </Switch>
                </SocketContext.Provider>
            </BrowserRouter>
        </React.StrictMode>
    );
};

export default App;
